import React from 'react';
import './LightIntensity.css';

const LightIntensity = ({ lightLevel }) => {
  const colors = {
    dark: '#3A5C40',           
    low: '#5D8C5A',            
    ideal: '#7CB45D',          
    high: '#F0A830',           
    danger: '#E05038',         
    textDark: '#1E3B23',       
    textLight: '#F0F7E6',      
    moss: '#6B8C42',           
    fern: '#8AAE92',           
    leafGreen: '#6FAD4E',      
    grassGreen: '#7DB953',     
    forestGreen: '#3B5E32',    
  };

  const getLightColor = (light) => {
    if (light === null) return colors.textDark;
    if (light < 2000) return colors.forestGreen;
    if (light < 10000) return colors.grassGreen;
    if (light < 30000) return colors.leafGreen;
    if (light < 50000) return colors.high;
    return colors.danger;
  };

  const getBackground = () => {
    return `radial-gradient(circle at center, ${colors.moss}, ${colors.fern})`;
  };

  const getPercentage = (light) => {
    if (!light) return 0;
    return Math.min(100, (light / 50000) * 100);
  };

  return (
    <div className="light-card" style={{ background: getBackground(), borderRadius: '15px'}}>
      <div className="light-header">
        <h1 className="light-title" style={{ color: colors.textLight }}>
          <span className="icon">üåø</span>  –û—Å–≤–µ—â–µ–Ω–∏–µ –∞–∫–≤–∞–ø–æ–Ω–∏–∫–∏ 
        </h1>
        <div className="light-icons">
          <span className="icon" style={{ color: colors.leafGreen}}>üå≤</span>
          <span className="icon" style={{ color: colors.leafGreen}}>‚òÄÔ∏è</span>
          <span className="icon" style={{ color: colors.leafGreen}}>üçÉ</span>
        </div>
      </div>

      <div className="light-display">
        <div className="light-value" style={{ color: getLightColor(lightLevel), fontSize: '2.5rem' }}>
          {lightLevel !== null ? lightLevel.toLocaleString() : '--'}
          <span className="light-unit" style={{fontSize:'1.1rem'}}>lux</span>
        </div>
        <div className="light-scale">
          <span style={{ color: colors.forestGreen }}>0</span>
          <div className="scale-bar">
            <div 
              className="scale-progress"
              style={{
                width: `${getPercentage(lightLevel)}%`, 
                background: `linear-gradient(to right,
                  ${getLightColor(lightLevel)}, 
                  transparent)`
              }}
            />
          </div>
          <span style={{ color: colors.danger }}>50k</span>
        </div>
      </div>

      <div className="light-footer">
        {lightLevel !== null && (
          <div className={`status-message ${
            lightLevel < 2000 ? 'status-dark' :
            lightLevel < 10000 ? 'status-low' :
            lightLevel < 30000 ? 'status-ideal' :
            lightLevel < 50000 ? 'status-high' : 'status-danger'
          }`}
          >
            {lightLevel < 2000 ? (
              <>üåë  –ù–µ–¥–æ—Å—Ç–∞—Ç–æ–∫ —Å–≤–µ—Ç–∞</>
            ) : lightLevel < 10000 ? (
              <>üåÑ –ù–µ–±–æ–ª—å—à–æ–µ –æ—Å–≤–µ—â–µ–Ω–∏–µ</>
            ) : lightLevel < 30000 ? (
              <>üåø –û—Ç–ª–∏—á–Ω—ã–π —Å–≤–µ—Ç!</>
            ) : lightLevel < 50000 ? (
              <>‚ú® –ò–∑–±—ã—Ç–æ–∫ —Å–≤–µ—Ç–∞</>
            ) : (
              <>‚ùó –û–ø–∞—Å–Ω—ã–π —É—Ä–æ–≤–µ–Ω—å!</>
            )}
          </div>
        )}
      </div>
      
      <div className="leaf-decoration">üçÇ</div>
    </div>
  );
};

export default LightIntensity;
